        <div className="feed">
        <div className="feed__left">
        <div className="feed__posts">
            {feed.map((post) => (<Post key={post.id} post={post} postImage={post.image} timestamp={post.created_at} author={post.author}/> ))}

                {/* // user={post.user}
                // 
                // likes={post.likes}
                //  */}

        </div>
        </div>
        <div className="feed__right">
        <Suggestions />
        </div>
    </div>
    )
}

export default Feed
